met Georgie Henley, William Moseley en Skandar Keynes

Vier Britse kinderen worden naar het buitenhuis van een professor gestuurd, waar ze veilig zullen zijn tijdens de Tweede 
Wereldoorlog. Ze vinden een magische garderobe, waarmee ze in het mysterieuze land Narnia kunnen komen. Het land wordt 
overheerst door een slechte heks, en om haar te kunnen verslaan, moeten de kinderen leeuwenkoning Aslan vergezellen.
